import React, { useState, useEffect } from 'react';
import "../Pages/Admin.css";

function AddProduct({ addProduct, updateProduct, selectedProduct, setSelectedProduct }) {
  const [productName, setProductName] = useState('');
  const [brand, setBrand] = useState('');
  const [category, setCategory] = useState('All');
  const [subCategory, setSubCategory] = useState('');
  const [specification, setSpecification] = useState('');
  const [unit, setUnit] = useState('pcs');
  const [tags, setTags] = useState('');
  const [description, setDescription] = useState('');
  const [price, setPrice] = useState('');
  const [compare, setCompare] = useState('');
  const [discount, setDiscount] = useState('');
  const [thumbnail, setThumbnail] = useState('');
  const [imgone, setImgOne] = useState('');
  const [imgtwo, setImgTwo] = useState('');
  const [imgthree, setImgThree] = useState('');
  const [rate, setRate] = useState(3.5);
  const [stock, setStock] = useState(1);
  const [sales, setSales] = useState('');
  const [ppv, setPpv] = useState('');

  // Load selected product into form for editing
  useEffect(() => {
    if (selectedProduct) {
      setProductName(selectedProduct.productName);
      setBrand(selectedProduct.brand);
      setCategory(selectedProduct.category);
      setSubCategory(selectedProduct.subCategory);
      setSpecification(selectedProduct.specification);
      setUnit(selectedProduct.unit);
      setTags(selectedProduct.tags);
      setDescription(selectedProduct.description);
      setPrice(selectedProduct.price);
      setCompare(selectedProduct.compare);
      setDiscount(selectedProduct.discount);
      setThumbnail(selectedProduct.thumbnail);
      setImgOne(selectedProduct.imgone);
      setImgTwo(selectedProduct.imgtwo);
      setImgThree(selectedProduct.imgthree);
      setRate(selectedProduct.rate);
      setStock(selectedProduct.stock);
      setSales(selectedProduct.sales);
      setPpv(selectedProduct.ppv);
    }
  }, [selectedProduct]);

  // Clear form fields
  function clear() {
    setProductName('');
    setBrand('');
    setCategory('All');
    setSubCategory('');
    setSpecification('');
    setUnit('pcs');
    setTags('');
    setDescription('');
    setPrice('');
    setCompare('');
    setDiscount('');
    setThumbnail('');
    setImgOne('');
    setImgTwo('');
    setImgThree('');
    setRate(3.5);
    setStock(1);
    setSales('');
    setPpv('');
    setSelectedProduct(null); // Reset selected product after clearing
  }

  function handleSubmit(e) {
    e.preventDefault();
    const productData = {
      productName, brand, category, subCategory, specification, unit, tags,
      description, price, compare, discount, thumbnail, imgone, imgtwo,
      imgthree, rate, stock, sales, ppv,
    };

    if (selectedProduct) {
      // Confirm before updating
      if (window.confirm(`Do you really want to edit this product?`)) {
        updateProduct({ ...productData, id: selectedProduct.id });
        clear();
      }
    } else {
      addProduct(productData);
      clear();
    }
  }

  return (
    <>
      <main className="addProductMain">
        <form onSubmit={handleSubmit}>
          <table className='addProductsMainTable'>
            <thead>
              <tr>
                <th colSpan="2"><h1>Product Information</h1></th>
              </tr>
            </thead>
            <tbody>
              {/* Product form fields */}
              {/* Similar form fields as before */}
            </tbody>
            <tfoot>
              <tr className='addtablefoot'>
                <td className='addproduct'>
                  <button type="submit" className='addSubmit'>
                    {selectedProduct ? 'Update Product' : 'Add Product'}
                  </button>
                </td>
                <td className='addproduct'>
                  <button type="button" onClick={clear} className='clearSubmit'>Clear Data</button>
                </td>
              </tr>
            </tfoot>
          </table>
        </form>
      </main>
    </>
  );
}

export default AddProduct;
